import myposts from './Profile.module.css'
import '../Profile/Posts/MyPosts'
import MyPosts from "./Posts/MyPosts";
const Profile = () => {
    return (
        <div className={myposts.content}>
            <div>
                <img className={myposts.content_bg_image} src={"https://flytothesky.ru/wp-content/uploads/2012/10/midnight-sun-in-lofoten-norway.jpg"}/>
            </div>
            <div>
                ava + desc
            </div>
            <MyPosts />
        </div>
    );
}

export default Profile;
